Sì, è necessario che il datore di lavoro abbia alcuni requisiti ben precisi per assumere un ruolo RSPP all'interno della propria azienda. In particolare, il candidato deve avere:

*   un diploma tecnico o laurea in materie come medicina del lavoro, ingegneria industriale e gestione ambientale;
*   almeno tre anni di esperienza in qualche campo della prevenzione infortuni ed ambientali;
*   un esame professionale presso la Commissione Provinciale per la Sicurezza sul Lavoro.

L'Inps, con la circolare n. 25 dell'11.2.2022, comunica le seguenti informazioni relative al reddito dovuto per il calcolo della Gestione separata:

*   Aliquote: 0,9% del reddito imponibile;
*   Minimo: 0,9% del reddito imponibile;
*   Massimo: 1,9% del reddito imponibile.
